import Goku from './components/Goku'

class App extends Component {
  render(){
    return (
      <div className="App">
        <h1>Vegeta vs Goku</h1>
        <hr/>
        <div className='row'>
          <Vegeta name ="Vegeta"/>
          <Goku name="Goku"/>
        </div>
      </div>
    );
  }
}
export default App;
